import React from 'react';
import { View, Text, Image, } from 'react-native';
import { Icon } from '../assets/Food.png';

function Cart(props) {
    return (
        <View style={{
            height: 170,
            margin: 10,

            shadowOffset: {
                height: 1,
                width: 1,
            },
            shadowColor: "black",
            shadowRadius: 5,
            elevation: 5,
            shadowOpacity: .1,
            borderRadius: 10,
            padding: 10,
        }}>
            <View style={{
                flexDirection: 'row',

            }}>
                <View>
                    <Image source={Icon} />
                </View>

            </View>

        </View>
    );
}

export default Cart;
